  false,\n\t\"url\": null,\n\t\"notes\": \"The primary goal of Big Stone National
  Wildlife Refuge is duck production; specifically, waterfowl maintenance, preservation
  and enhancement of diversity of indigenous plant and animal communities, and promoting
  an appreciation of wildlife and natural ecosystems through educational and interpretive
  opportunities for the public. The Refuge is proposing a three year study of the
  impacts of skunk removal during the nesting season on the success rates of upland
  nesting ducks. Studies suggest that mammalian predation is limiting duck nesting
  success on Big Stone National Wildlife Refuge.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
